class Solution {
public:
    int maxTotalReward(vector<int>& nums) {
        set<int> mySet;
        for(auto e: nums) mySet.insert(e);
        vector<int> mem(*--mySet.end(), 0);
        mem[0] = 1;
        int ans = 0;
        for(auto e: mySet){
            if(e == *--mySet.end()) break;
            for(int i = 0; i < e && i + e < mem.size(); ++i){
                if(!mem[i]) continue;
                mem[i + e] = 1, ans = max(ans, i + e);
            }
        }
        return ans + *(--mySet.end());
    }
};
